import React, { useState } from "react";
import { Link, useLocation } from "react-router-dom";
import { BsChevronDown, BsChevronUp } from "react-icons/bs";
import styled from "styled-components";

const Nav = styled.nav`
  flex: 1;
  background-color: rgba(30, 30, 44, 1);
  color: white;
  display: flex;
  flex-direction: column;
  padding: 20px;
  justify-content: flex-start;
`;

const TitleText = styled.div`
  color: #fff;
  font-family: "NotoSansKR";
  font-size: 20px;
  font-style: normal;
  font-weight: 400;
  line-height: 44px; /* 220% */
  letter-spacing: -1.8px;
`;

const HRLight = styled.hr`
  width: 99.5%;
  margin-top: 27px;
  border: 1px dotted #d9d9d9;
  background-color: #d9d9d9;
  margin-bottom: 10px;
`;

const Ul = styled.ul`
  list-style-type: none;
  padding: 0;
`;

const DisplayDiv = styled.div`
  display: flex;
  align-items: center;
`;

const Icon = styled.img`
  width: ${(props) => props.width}px;
  height: ${(props) => props.height}px;
  margin-right: ${(props) => props.right}px;
`;

const MenuItem = styled.li`
  display: block;
  font-family: "NotoSansKR";
  min-height: 30px;
  margin-top: 10px;
  height: auto;
  font-size: 16px;
  font-style: normal;
  font-weight: 400;
  line-height: 140%;
`;

const MenuLink = styled(Link)`
  text-decoration: none;
  display: flex;
  align-items: center;
  /* gap: 8px; */
  height: 40px;
  /* background-color: red; */
  font-family: "NotoSansKR";
  font-size: 16px;
  font-style: normal;
  font-weight: 400;
  line-height: 140%;
  color: ${(props) => (props.active ? "#0079E0" : "#FFFFFF")};
`;

const CircleIcon = styled.span`
  display: inline-block;
  width: 10px;
  height: 10px;
  border-radius: 50%;
  background-color: ${(props) => (props.active ? "#0079E0" : "#FFFFFF")};
  margin-right: 8px;
  margin-left: 20px;
`;

function NavBar() {
  const [isSubMainOpen, setIsSubMainOpen] = useState(false);
  const [isSubCommunicationOpen, setIsSubCommunicationOpen] = useState(false);
  const [isSubDataCollectionOpen, setIsSubDataCollectionOpen] = useState(false);
  const [isSubMemberOpen, setIsSubMemberOpen] = useState(false);
  const { pathname } = useLocation(); // 현재 페이지의 URL을 가져옴

  return (
    <Nav>
      <Ul>
        <li>
          <TitleText>한동대 총학생회 관리</TitleText>
        </li>
        <HRLight />
        <li>
          <DisplayDiv>
            {pathname === "/" ? (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/homeIconAct.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            ) : (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/HomeIcon.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            )}
            <MenuLink to="/" active={pathname === "/"}>
              홈
            </MenuLink>
          </DisplayDiv>
        </li>
        <MenuItem isSubMainOpen={isSubMainOpen}>
          <DisplayDiv>
            <Icon
              src={require("../Assets/Img/NavBar_Img/MainIcon.png")}
              width={24}
              height={24}
              right={14}
            />
            <span
              onClick={() => setIsSubMainOpen(!isSubMainOpen)}
              style={{ cursor: "pointer" }}
            >
              메인 페이지 {isSubMainOpen ? <BsChevronUp /> : <BsChevronDown />}
            </span>
          </DisplayDiv>
          {isSubMainOpen && (
            <Ul>
              <li>
                <MenuLink
                  to="/main/banner"
                  active={pathname === "/main/banner"}
                >
                  <CircleIcon active={pathname === "/main/banner"}/>
                  베너 관리
                </MenuLink>
              </li>
              <li>
                <MenuLink to="/main/popup" active={pathname === "/main/popup"}>
                  <CircleIcon active={pathname === "/main/popup"} />
                  팝업 관리
                </MenuLink>
              </li>
              <li>
                <MenuLink
                  to="/main/schedule"
                  active={pathname === "/main/schedule"}
                >
                  <CircleIcon active={pathname === "/main/schedule"} />
                  일정 관리
                </MenuLink>
              </li>
            </Ul>
          )}
        </MenuItem>
        <li>
          <DisplayDiv>
            {pathname.startsWith("/notice") ? (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/NoticeIconAct.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            ) : (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/NoticeIcon.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            )}
            <MenuLink to="/notice" active={pathname.startsWith("/notice")}>
              공지사항
            </MenuLink>
          </DisplayDiv>
        </li>
        <li>
          <DisplayDiv>
            {pathname.startsWith("/shopManager") ? (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/HGUSHOPIMGAct.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            ) : (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/HGUSHOPICON.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            )}
            <MenuLink
              to="/shopManager"
              active={pathname.startsWith("/shopManager")}
            >
              HGU 샵 관리
            </MenuLink>
          </DisplayDiv>
        </li>
        <MenuItem isSubCommunicationOpen={isSubCommunicationOpen}>
          <DisplayDiv>
            <Icon
              src={require("../Assets/Img/NavBar_Img/CommunicationIcon.png")}
              width={24}
              height={24}
              right={14}
            />
            <span
              onClick={() => setIsSubCommunicationOpen(!isSubCommunicationOpen)}
              style={{ cursor: "pointer" }}
            >
              소통{" "}
              {isSubCommunicationOpen ? <BsChevronUp /> : <BsChevronDown />}
            </span>
          </DisplayDiv>
          {isSubCommunicationOpen && (
            <Ul>
              <li>
                <MenuLink
                  to="/communication/suggestion"
                  active={pathname.startsWith("/communication/suggestion")}
                >
                  <CircleIcon
                    active={pathname.startsWith("/communication/suggestion")}
                  />
                  건의 관리
                </MenuLink>
              </li>
              <li>
                <MenuLink
                  to="/communication/ask"
                  active={pathname.startsWith("/communication/ask")}
                >
                  <CircleIcon
                    active={pathname.startsWith("/communication/ask")}
                  />
                  문의 관리
                </MenuLink>
              </li>
            </Ul>
          )}
        </MenuItem>
        <MenuItem isSubDataCollectionOpen={isSubDataCollectionOpen}>
          <DisplayDiv>
            <Icon
              src={require("../Assets/Img/NavBar_Img/LibraryIcon.png")}
              width={24}
              height={24}
              right={14}
            />
            <span
              onClick={() =>
                setIsSubDataCollectionOpen(!isSubDataCollectionOpen)
              }
              style={{ cursor: "pointer" }}
            >
              자료집{" "}
              {isSubDataCollectionOpen ? <BsChevronUp /> : <BsChevronDown />}
            </span>
          </DisplayDiv>
          {isSubDataCollectionOpen && (
            <Ul>
              <li>
                <MenuLink
                  to="/dataCollection/studentCouncil"
                  active={pathname.startsWith("/dataCollection/studentCouncil")}
                >
                  <CircleIcon
                    active={pathname.startsWith(
                      "/dataCollection/studentCouncil"
                    )}
                  />
                  총학생회
                </MenuLink>
              </li>
              <li>
                <MenuLink
                  to="/dataCollection/clubUnion"
                  active={pathname.startsWith("/dataCollection/clubUnion")}
                >
                  <CircleIcon
                    active={pathname.startsWith("/dataCollection/clubUnion")}
                  />
                  총동연
                </MenuLink>
              </li>
              <li>
                <MenuLink
                  to="/dataCollection/electionCommittee"
                  active={pathname.startsWith(
                    "/dataCollection/electionCommittee"
                  )}
                >
                  <CircleIcon
                    active={pathname.startsWith(
                      "/dataCollection/electionCommittee"
                    )}
                  />
                  총선관위
                </MenuLink>
              </li>
            </Ul>
          )}
        </MenuItem>
        <MenuItem isSubMemberOpen={isSubMemberOpen}>
          <DisplayDiv>
            <Icon
              src={require("../Assets/Img/NavBar_Img/MemberIcon.png")}
              width={24}
              height={24}
              right={14}
            />
            <span
              onClick={() => setIsSubMemberOpen(!isSubMemberOpen)}
              style={{ cursor: "pointer" }}
            >
              회원 {isSubMemberOpen ? <BsChevronUp /> : <BsChevronDown />}
            </span>
          </DisplayDiv>
          {isSubMemberOpen && (
            <Ul>
              <li>
                <MenuLink
                  to="/members/memberManager"
                  active={pathname.startsWith("/members/memberManager")}
                >
                  <CircleIcon
                    active={pathname.startsWith("/members/memberManager")}
                  />
                  회원 관리
                </MenuLink>
              </li>
              <li>
                <MenuLink
                  to="/members/adminPermissions"
                  active={pathname.startsWith("/members/adminPermissions")}
                >
                  <CircleIcon
                    active={pathname.startsWith("/members/adminPermissions")}
                  />
                  관리자 권한
                </MenuLink>
              </li>
            </Ul>
          )}
        </MenuItem>
        <li>
          <DisplayDiv>
            {pathname.startsWith("/setting") ? (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/SettingIconAct.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            ) : (
              <>
                <Icon
                  src={require("../Assets/Img/NavBar_Img/SettingIcon.png")}
                  width={24}
                  height={24}
                  right={14}
                />
              </>
            )}
            <MenuLink to="/setting" active={pathname.startsWith("/setting")}>
              설정
            </MenuLink>
          </DisplayDiv>
        </li>
        <li>
          <a href="https://accounts.google.com/o/oauth2/v2/auth?scope=https://www.googleapis.com/auth/userinfo.profile https://www.googleapis.com/auth/userinfo.email&client_id=227722031198-nhbfnoh6o28r33igqfq9u795rm2rc79r.apps.googleusercontent.com&response_type=code&redirect_uri=http://localhost:3000/login/oauth/google&access_type=offline">
            임시 로그인 버튼
          </a>
        </li>
      </Ul>
    </Nav>
  );
}

export default NavBar;
